// Generated by BUCKLESCRIPT, PLEASE EDIT WITH CARE
'use strict';

var DateFns = require("../../../shared/utils/DateFns.bs.js");

function value(t) {
  return t.value;
}

function coachName(t) {
  return t.coachName;
}

function coachAvatarUrl(t) {
  return t.coachAvatarUrl;
}

function coachTitle(t) {
  return t.coachTitle;
}

function createdAtPretty(t) {
  return DateFns.format(t.createdAt, "MMMM d, yyyy");
}

function make(coachName, coachAvatarUrl, coachTitle, createdAt, value) {
  return {
          createdAt: createdAt,
          value: value,
          coachName: coachName,
          coachAvatarUrl: coachAvatarUrl,
          coachTitle: coachTitle
        };
}

exports.value = value;
exports.coachName = coachName;
exports.coachAvatarUrl = coachAvatarUrl;
exports.coachTitle = coachTitle;
exports.createdAtPretty = createdAtPretty;
exports.make = make;
/* DateFns Not a pure module */
